import styled from "styled-components";
import tw from "tailwind.macro";


const AdminTW = styled.div.attrs({
    className: ""
  })` & {

    .row{
        ${tw`flex mb-4`}
    }
    .w-1/2{
        ${tw`w-1/2`}
    }


}`;

export default AdminTW;
